{
  "translationLines": [
    {
      "lineNumber": 181681,
      "originalJapaneseLine": "シィルは緊張気味に建物を見上げた。",
      "translatedEnglishLine": "Seere looked up at the building with a tense feeling."
    },
    {
      "lineNumber": 181682,
      "originalJapaneseLine": "今からここに入るのだと思うと、",
      "translatedEnglishLine": "Thinking that they were going to enter here now,"
    },
    {
      "lineNumber": 181683,
      "originalJapaneseLine": "溢れ出す恐瘴気の色は濃さを増したように見え、",
      "translatedEnglishLine": "The overflowing aura of terrifying miasma seemed to have deepened in color,"
    },
    {
      "lineNumber": 181684,
      "originalJapaneseLine": "その禍々しさに背に冷や汗が流れた。",
      "translatedEnglishLine": "Its ominousness sent a cold sweat down her back."
    },
    {
      "lineNumber": 181685,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 181686,
      "originalJapaneseLine": "「ビビるな！",
      "translatedEnglishLine": "\"Don't be scared!"
    },
    {
      "lineNumber": 181687,
      "originalJapaneseLine": "　ケイブリスさえ倒せば全て終わるんだからな！」",
      "translatedEnglishLine": "If we can just defeat Cavebris, everything will be over!\""
    },
    {
      "lineNumber": 181688,
      "originalJapaneseLine": "「は、はい……！」",
      "translatedEnglishLine": "\"Y-yes...!\""
    },
    {
      "lineNumber": 181689,
      "originalJapaneseLine": "「行くぞ！」",
      "translatedEnglishLine": "\"Let's go!\""
    },
    {
      "lineNumber": 181690,
      "originalJapaneseLine": "ケイブリスから発せられる恐瘴気が",
      "translatedEnglishLine": "The terrifying miasma emanating from Cavebris"
    },
    {
      "lineNumber": 181691,
      "originalJapaneseLine": "圧迫感となってランス達にのしかかる。",
      "translatedEnglishLine": "pressed down on Lance and the others like suffocating pressure."
    },
    {
      "lineNumber": 181692,
      "originalJapaneseLine": "「う……き、気持ち悪い、です……",
      "translatedEnglishLine": "\"Ugh... I-I'm feeling sick..."
    },
    {
      "lineNumber": 181693,
      "originalJapaneseLine": "　なんだか、くらくらして……」",
      "translatedEnglishLine": "Somehow, I'm feeling dizzy...\""
    },
    {
      "lineNumber": 181694,
      "originalJapaneseLine": "「そ、それに……体が勝手に……」",
      "translatedEnglishLine": "\"A-and also... my body is acting on its own...\""
    },
    {
      "lineNumber": 181695,
      "originalJapaneseLine": "シィルは顔をかすかに青くして、",
      "translatedEnglishLine": "Seere's face turned slightly pale,"
    },
    {
      "lineNumber": 181696,
      "originalJapaneseLine": "両手で自分の肩を抱いていた。",
      "translatedEnglishLine": "and she hugged her own shoulders with both hands."
    },
    {
      "lineNumber": 181697,
      "originalJapaneseLine": "全身の血液が静かに冷えるような、",
      "translatedEnglishLine": "It was a fear like nothing she had felt before, as if the blood throughout her body quietly chilled."
    },
    {
      "lineNumber": 181698,
      "originalJapaneseLine": "今までに感じたことのないような恐怖。",
      "translatedEnglishLine": "A terror she had never experienced until now."
    },
    {
      "lineNumber": 181699,
      "originalJapaneseLine": "シィルは自分の体から力が抜け、",
      "translatedEnglishLine": "Seere felt strength leaving her body,"
    },
    {
      "lineNumber": 181700,
      "originalJapaneseLine": "動きが鈍くなるのを実感していた。",
      "translatedEnglishLine": "and she realized her movements were becoming sluggish."
    },
    {
      "lineNumber": 181701,
      "originalJapaneseLine": "「ちっ、恐瘴気とやらが徐々に",
      "translatedEnglishLine": "\"Tch, this terrifying miasma is gradually"
    },
    {
      "lineNumber": 181702,
      "originalJapaneseLine": "　ひどくなってきたな……」",
      "translatedEnglishLine": "getting worse...\""
    },
    {
      "lineNumber": 181703,
      "originalJapaneseLine": "「本体に近ければ近いほど、",
      "translatedEnglishLine": "\"The closer we get to the main body,"
    },
    {
      "lineNumber": 181704,
      "originalJapaneseLine": "　恐瘴気は濃くなるようですね」",
      "translatedEnglishLine": "the thicker the terrifying miasma becomes, it seems.\""
    },
    {
      "lineNumber": 181705,
      "originalJapaneseLine": "「常に毒を吐き出してるみたいなもんだな。",
      "translatedEnglishLine": "\"It's like it's constantly spewing poison."
    },
    {
      "lineNumber": 181706,
      "originalJapaneseLine": "　ったく、迷惑な魔人だぜ」",
      "translatedEnglishLine": "Damn, what a nuisance demon this is.\""
    },
    {
      "lineNumber": 181707,
      "originalJapaneseLine": "「迷惑ゥゥ？」",
      "translatedEnglishLine": "\"A nuisance, huh?\""
    },
    {
      "lineNumber": 181708,
      "originalJapaneseLine": "「けっ、弱っちい癖に偉そうな",
      "translatedEnglishLine": "\"Hmph, you weaklings acting all high and mighty"
    },
    {
      "lineNumber": 181709,
      "originalJapaneseLine": "　人間なんぞに言われたくねぇぜ」",
      "translatedEnglishLine": "I don't want to be told that by humans like you.\""
    },
    {
      "lineNumber": 181710,
      "originalJapaneseLine": "がらがらと、金属同士を擦り合わせたような",
      "translatedEnglishLine": "A grating voice, like metal scraping against metal,"
    },
    {
      "lineNumber": 181711,
      "originalJapaneseLine": "不愉快な声が鼓膜を震わせた。",
      "translatedEnglishLine": "shook their eardrums unpleasantly."
    },
    {
      "lineNumber": 181712,
      "originalJapaneseLine": "「む……」",
      "translatedEnglishLine": "\"Hmm...\""
    },
    {
      "lineNumber": 181713,
      "originalJapaneseLine": "「てめぇら人間はなぁ、",
      "translatedEnglishLine": "\"You humans, listen up,"
    },
    {
      "lineNumber": 181714,
      "originalJapaneseLine": "　生きてるだけで公害なんだよ」",
      "translatedEnglishLine": "just by being alive, you're an environmental hazard.\""
    },
    {
      "lineNumber": 181715,
      "originalJapaneseLine": "「魔人……ケイブリス……！」",
      "translatedEnglishLine": "\"Demon... Cavebris...!\""
    },
    {
      "lineNumber": 181716,
      "originalJapaneseLine": "「ほほう、ようやく会えたな」",
      "translatedEnglishLine": "\"Hoho, we've finally met.\""
    },
    {
      "lineNumber": 181717,
      "originalJapaneseLine": "「まあったく、見張りは何してやがんだ……",
      "translatedEnglishLine": "\"Honestly, what have your lookouts been doing..."
    },
    {
      "lineNumber": 181718,
      "originalJapaneseLine": "　こんなとこまで調子こいた",
      "translatedEnglishLine": "For such a cocky little human to come this far"
    },
    {
      "lineNumber": 181719,
      "originalJapaneseLine": "　チビカスの人間が入ってきてんじゃねぇか」",
      "translatedEnglishLine": "into a place like this.\""
    },
    {
      "lineNumber": 181720,
      "originalJapaneseLine": "「チッ！」",
      "translatedEnglishLine": "\"Tch!\""
    },
    {
      "lineNumber": 181721,
      "originalJapaneseLine": "「――ひっ！」",
      "translatedEnglishLine": "\"--Eep!\""
    },
    {
      "lineNumber": 181722,
      "originalJapaneseLine": "怒りを露わにし、舌を打つ。",
      "translatedEnglishLine": "Expressing anger, he clicked his tongue."
    },
    {
      "lineNumber": 181723,
      "originalJapaneseLine": "たったそれだけで何人かの女の子は身を竦ませた。",
      "translatedEnglishLine": "Just that was enough to make several girls flinch."
    },
    {
      "lineNumber": 181724,
      "originalJapaneseLine": "四本の角と六本の腕を生やす異形、",
      "translatedEnglishLine": "A monstrous figure with four horns and six arms,"
    },
    {
      "lineNumber": 181725,
      "originalJapaneseLine": "ゆうに六メートルはあろうかという巨躯。",
      "translatedEnglishLine": "a colossal body easily six meters tall."
    },
    {
      "lineNumber": 181726,
      "originalJapaneseLine": "何よりも体から放たれる禍々しい瘴気。",
      "translatedEnglishLine": "Above all, the malevolent miasma emanating from its body."
    },
    {
      "lineNumber": 181727,
      "originalJapaneseLine": "魔人ケイブリスは、",
      "translatedEnglishLine": "The demon Cavebris"
    },
    {
      "lineNumber": 181728,
      "originalJapaneseLine": "恐怖と暴力を具現化したかのような姿だった。",
      "translatedEnglishLine": "appeared as if fear and violence had taken form."
    },
    {
      "lineNumber": 181729,
      "originalJapaneseLine": "「あァン？　なんだ？",
      "translatedEnglishLine": "\"Huh? What is it?"
    },
    {
      "lineNumber": 181730,
      "originalJapaneseLine": "　人の部屋に入っておいて挨拶もなしか？」",
      "translatedEnglishLine": "You come into my room without even a greeting?\""
    },
    {
      "lineNumber": 181731,
      "originalJapaneseLine": "「がははは、今から殺す奴に挨拶が必要か？」",
      "translatedEnglishLine": "\"Gahahaha, do you need to greet the person you're about to kill?\""
    },
    {
      "lineNumber": 181732,
      "originalJapaneseLine": "「……けっ」",
      "translatedEnglishLine": "\"...Tch.\""
    },
    {
      "lineNumber": 181733,
      "originalJapaneseLine": "「魔王ガイの統治以降、人間って奴ぁ",
      "translatedEnglishLine": "\"Since the rule of Demon Lord Gai, humans have"
    },
    {
      "lineNumber": 181734,
      "originalJapaneseLine": "　本当に調子に乗るようになったな」",
      "translatedEnglishLine": "really become cocky, haven't they?\""
    },
    {
      "lineNumber": 181735,
      "originalJapaneseLine": "「てめぇらは殺す。",
      "translatedEnglishLine": "\"I'm going to kill you all."
    },
    {
      "lineNumber": 181736,
      "originalJapaneseLine": "　だが、ただ殺すだけじゃねぇ」",
      "translatedEnglishLine": "But I won’t just kill you."
    },
    {
      "lineNumber": 181737,
      "originalJapaneseLine": "「何年もかけて苦痛を与え、",
      "translatedEnglishLine": "\"I will give you pain over many years,"
    },
    {
      "lineNumber": 181738,
      "originalJapaneseLine": "　元の顔すら分からなくなるほど痛めつけ、",
      "translatedEnglishLine": "torment you until you don’t even recognize your own face,"
    },
    {
      "lineNumber": 181739,
      "originalJapaneseLine": "　それから生きたまま磔にする」",
      "translatedEnglishLine": "and then crucify you alive.\""
    },
    {
      "lineNumber": 181740,
      "originalJapaneseLine": "「人間が魔人様に逆らう気が",
      "translatedEnglishLine": "\"If humans think they can oppose a demon lord"
    }
  ]
}

